const Landing = () => {
  // let movies = ListMovies[0];
  return (

    <StyledBg className='bg-netflix w-full h-screen overflow-y-auto'>
      <ClipLoader color="#ffffff;" />
        <Title/>
    </StyledBg>
  )
}
export default Landing

const StyledBg = Styled.div`
  background: url(${ListMovies[0].bg});
  background-size: cover;

`
